    CREATE TABLE "Users"(
        user_id     SERIAL PRIMARY KEY,
        name      varchar(10)
    );   

    CREATE TABLE "COMPUTER DATA"(
        call_number
        user_id                    SERIAL PRIMARY KEY,
        seriel_number           varchar(255),
        manufacturer            varchar(255),
        model                   varchar(255),
        computer_name           varchar(255),
        locaiton                varchar(255),
        operating_system        varchar(255),
        os_architchure          varchar(255),
        total_system_memory     varchar(255),
        video                   varchar(255),
        video_memory            varchar(255),
        dns_domain              varchar(255),
        last_known_ip           varchar(255),
        mac                     varchar(255)
    );

